import React, { useState } from "react";

const GradCAMVisualization = ({ originalImage, gradcamImage, prediction, confidence, isLoading }) => {
  const [opacity, setOpacity] = useState(0.5);
  const [imageError, setImageError] = useState(false);
  const [selectedView, setSelectedView] = useState('combined');

  const getImageUrl = (base64Data) => {
    if (!base64Data) return null;
    return `data:image/png;base64,${base64Data}`;
  };

  const handleImageError = () => {
    setImageError(true);
    console.error("Failed to load visualization");
  };

  const renderImage = (src, alt) => (
    <img
      src={src}
      alt={alt}
      className="w-full h-64 object-contain rounded"
      onError={handleImageError}
    />
  );

  const renderOverlay = () => (
    <div className="relative h-64">
      <img
        src={getImageUrl(originalImage)}
        alt="Original"
        className="absolute top-0 left-0 w-full h-full object-contain grayscale"
      />
      <img
        src={getImageUrl(gradcamImage)}
        alt="Grad-CAM"
        className="absolute top-0 left-0 w-full h-full object-contain"
        style={{ opacity: opacity }}
      />
    </div>
  );

  if (isLoading) {
    return (
      <div className="h-64 flex items-center justify-center">
        <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Prediction Display */}
      {prediction && (
        <div className="bg-white p-4 rounded-lg shadow-sm">
          <div className="grid grid-cols-2 gap-4">
            <div>
              <p className="text-sm text-gray-500">Predicted Class</p>
              <p className="text-lg font-medium text-gray-900">{prediction}</p>
            </div>
            <div>
              <p className="text-sm text-gray-500">Confidence</p>
              <p className="text-lg font-medium text-gray-900">
                {confidence?.toFixed(2)}%
              </p>
            </div>
          </div>
        </div>
      )}

      {/* Visualization Section */}
      <div className="bg-white rounded-lg shadow-sm overflow-hidden">
        <div className="p-4 border-b">
          <h3 className="text-lg font-semibold text-gray-800">
            Grad-CAM Visualization
          </h3>
        </div>

        <div className="p-4 space-y-4">
          {/* Image Display */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            {selectedView === 'original' && renderImage(getImageUrl(originalImage), "Original Image")}
            {selectedView === 'gradcam' && renderImage(getImageUrl(gradcamImage), "Grad-CAM")}
            {selectedView === 'combined' && renderOverlay()}
          </div>

          {/* View Controls */}
          <div className="flex justify-center gap-2">
            <button
              onClick={() => setSelectedView('original')}
              className={`px-3 py-1 rounded text-sm ${
                selectedView === 'original'
                  ? 'bg-blue-600 text-white'
                  : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
              }`}
            >
              Original
            </button>
            <button
              onClick={() => setSelectedView('gradcam')}
              className={`px-3 py-1 rounded text-sm ${
                selectedView === 'gradcam'
                  ? 'bg-blue-600 text-white'
                  : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
              }`}
            >
              Grad-CAM
            </button>
            <button
              onClick={() => setSelectedView('combined')}
              className={`px-3 py-1 rounded text-sm ${
                selectedView === 'combined'
                  ? 'bg-blue-600 text-white'
                  : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
              }`}
            >
              Combined
            </button>
          </div>

          {/* Opacity Slider */}
          {selectedView === 'combined' && (
            <div className="space-y-2">
              <label className="text-sm font-medium text-gray-700">
                Overlay Opacity: {(opacity * 100).toFixed(0)}%
              </label>
              <input
                type="range"
                min="0"
                max="1"
                step="0.1"
                value={opacity}
                onChange={(e) => setOpacity(parseFloat(e.target.value))}
                className="w-full"
              />
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default GradCAMVisualization;
